import React from "react";
import InputRow from "./row/InputRow";

export default function RegisterUsers() {

    const [user, setUser] = React.useState({
        name: '',
        surname: '',
        email: '',
        username: '',
        password: '',
        confirm_password: ''
    })
    console.log(user)

    function handleInputChange(e){
        const {name, value} = e.target

        setUser(prevValue => {
            return {
                ...prevValue,
                [name]: value
            }
        })
    }

    return (
        <div className="form-card">
            <form>
                <div className="pill">Hey</div>
                <br />
                <InputRow>
                    <input
                        type='text'
                        name="name"
                        onChange={handleInputChange}
                        value={user.name}
                        placeholder="name"
                    />
                    <p>Another element</p>
                    <p>Another element</p>
                    <p>Another element</p>
                </InputRow>
            </form>
        </div>
    )
}
